INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 1, 1, 24, 24001, 0, "リン", 10040, 102601, "あたしだって\nやるときはやるよ！", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 1, 1, 24, 24002, 1, "リン", 10040, 102601, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 1, 1, 24, 24003, 2, "リン", 10040, 102601, "終わった終わった\n一人でもなんとか\nなるもんだね", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 2, 2, 24, 24004, 3, "リン", 10040, 102601, "やったね！\nこれでようやく\nサボれるよ…", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 1, 1, 24, 24005, 4, "リン", 10040, 102601, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 2, 2, 24, 24006, 5, "リン", 10040, 102601, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 2, 2, 24, 24007, 6, "リン", 10040, 102601, "あたしも意外と\nやるもんでしょ？", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 4, 4, 24, 24008, 7, "リン", 10040, 102601, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 4, 4, 24, 24009, 8, "リン", 10040, 102601, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 4, 4, 24, 24010, 9, "リン", 10040, 102601, "まじめに\nやったんだけどな…\n悔しいな～", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 4, 4, 24, 24011, 10, "リン", 10040, 102601, "やられた…\nねずみって意外と\nてごわいね", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 4, 4, 24, 24012, 11, "リン", 10040, 102601, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2020/04/30 12:00:00", 0.0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (0.0, 1, 4, 24, 24013, 12, "リン", 10040, 102601, "疲れた…\nけど、次こそは\n守り抜くよ…", "2020/04/30 12:00:00", 1.81, 0.0, "2030/12/17 14:59:59");
